// property-service.js

import axios from 'axios';
import authHeader from './auth-header';

const API_URL = "http://localhost:3003/api/v1/";

const getAllProperties = () => {
  return axios.get(API_URL + "properties", { headers: authHeader() });
};

export default {
  getAllProperties,
};
